import React from "react";

import QuoteForm from "../components/quotes/QuoteForm";

const NewQuote = () => {
   const addQuoteHanlder = (quoteData) => {
      console.log(quoteData);
   };

   return;
   <>
      <QuoteForm onAddQuote={addQuoteHanlder} />
   </>;
};

export default NewQuote;
